package bean;

public class tkbean {

	private String matv;
	private String httv;
	private String dtb;
	public tkbean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public tkbean(String matv, String httv, String dtb) {
		super();
		this.matv = matv;
		this.httv = httv;
		this.dtb = dtb;
	}
	public String getMatv() {
		return matv;
	}
	public void setMatv(String matv) {
		this.matv = matv;
	}
	public String getHttv() {
		return httv;
	}
	public void setHttv(String httv) {
		this.httv = httv;
	}
	public String getDtb() {
		return dtb;
	}
	public void setDtb(String dtb) {
		this.dtb = dtb;
	}
	
}
